import React, { useEffect, useState } from 'react'
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

function PRDetails() {
    let [PRdata, setPRData] = useState([]);
    let tempData;
    useEffect(() => {
        fetch('http://localhost:5000/print-data')
            .then((response) => response.json())
            .then((data) => setPRData(data))
            .then(() => tempData = PRDetails);
    }, [])

    const faTrash = require("@fortawesome/free-solid-svg-icons/faTrash");
  return (
    
    <table style={{ width: "80vw" }}>
        <tr>
          <th>Name</th>
          <th>Email</th>
          <th>User Type</th>
          <th>Delete</th>
        </tr>
        {PRdata.map((i, id) => {
          return (
            <tr key={id} >
              <td>{i.fname}</td>
              <td>{i.email}</td>
              <td>{i.userType}</td>
              <td>{i.location}</td>
              <td>{i.mobile}</td>
              <td>
                <FontAwesomeIcon
                  icon={faTrash}
                />
              </td>
            </tr>
          )})}
      </table>
  )
}

export default PRDetails
